import React from "react";
import "./css/SignUp.css";

export default function SignUp() {
  //css 선언부
  const FORMCSS =
    "flex flex-col items-center container rounded p-5 mx-2xl bg-white";
  const INPUTCSS = "border border-gray-500 h-8 w-32";

  return (
    <div className=" flex ">
      <form className={FORMCSS}>
        <div>
          아이디
          <span className="border border-gray-500 h-51px w-460px">
            <input
              className="  "
              type="text"
            />
          </span>
        </div>
        <div>
          비밀번호
          <input></input>
        </div>
        <div>비밀번호 재확인</div>
        <div>이름</div>
        <div>생년월일</div>
        <div>성별</div>
        <div>주소</div>
        <div>휴대전화</div>
        <div>가입하기</div>
      </form>
    </div>
  );
}
